import React, { useState } from "react";
import axios from "axios";

export default function App() {
  const [correo, setCorreo] = useState("");
  const [ruc, setRuc] = useState("");
  const [placa, setPlaca] = useState("");
  const [cedula, setCedula] = useState("");

  const [resultadoSRI, setResultadoSRI] = useState(null);
  const [resultadoVehiculo, setResultadoVehiculo] = useState(null);
  const [resultadoLicencia, setResultadoLicencia] = useState(null);

  // Consulta SRI
  const consultarSRI = async () => {
    try {
      const res = await axios.get(`http://localhost:8080/api/sri/${ruc}`);
      setResultadoSRI(res.data); // res.data es un objeto
    } catch (err) {
      setResultadoSRI({ error: "Error consultando SRI" });
    }
  };

  // Consulta Vehículo
  const consultarVehiculo = async () => {
    try {
      const res = await axios.get(`http://localhost:8080/api/vehiculo/${placa}`);
      setResultadoVehiculo(res.data);
    } catch (err) {
      setResultadoVehiculo({ error: "Error consultando vehículo" });
    }
  };

  // Consulta Licencia
  const consultarLicencia = async () => {
    try {
      const res = await axios.get(`http://localhost:8080/api/licencia/${cedula}/${placa}`);
      setResultadoLicencia(res.data);
    } catch (err) {
      setResultadoLicencia({ error: "Error consultando licencia" });
    }
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>Consulta SRI / ANT</h1>

      <div>
        <input
          placeholder="Correo"
          value={correo}
          onChange={(e) => setCorreo(e.target.value)}
          style={{ marginBottom: "10px", width: "300px" }}
        />
      </div>

      <div>
        <input
          placeholder="RUC"
          value={ruc}
          onChange={(e) => setRuc(e.target.value)}
          style={{ marginRight: "10px" }}
        />
        <button onClick={consultarSRI}>Consultar SRI</button>
      </div>

      {resultadoSRI && (
        <div style={{ marginTop: "10px", padding: "10px", border: "1px solid gray" }}>
          <h3>Resultado SRI:</h3>
          {resultadoSRI.error ? (
            <p>{resultadoSRI.error}</p>
          ) : (
            <div>
              <p>RUC: {resultadoSRI.numeroRuc}</p>
              <p>Razón Social: {resultadoSRI.razonSocial}</p>
              <p>Estado: {resultadoSRI.estadoContribuyenteRuc}</p>
              <p>Actividad Económica: {resultadoSRI.actividadEconomicaPrincipal}</p>
              <p>Tipo Contribuyente: {resultadoSRI.tipoContribuyente}</p>
              <p>Régimen: {resultadoSRI.regimen}</p>
              <p>Categoría: {resultadoSRI.categoria}</p>
              <p>Obligado a llevar contabilidad: {resultadoSRI.obligadoLlevarContabilidad}</p>
            </div>
          )}
        </div>
      )}

      <div style={{ marginTop: "20px" }}>
        <input
          placeholder="Placa"
          value={placa}
          onChange={(e) => setPlaca(e.target.value)}
          style={{ marginRight: "10px" }}
        />
        <button onClick={consultarVehiculo}>Consultar Vehículo</button>
      </div>

      {resultadoVehiculo && (
        <div style={{ marginTop: "10px", padding: "10px", border: "1px solid gray" }}>
          <h3>Resultado Vehículo:</h3>
          {resultadoVehiculo.error ? (
            <p>{resultadoVehiculo.error}</p>
          ) : (
            <div>
              <p>Placa: {resultadoVehiculo.placa}</p>
              <p>Marca: {resultadoVehiculo.marca}</p>
              <p>Modelo: {resultadoVehiculo.modelo}</p>
              <p>Año: {resultadoVehiculo.anio}</p>
              <p>Color: {resultadoVehiculo.color}</p>
            </div>
          )}
        </div>
      )}

      <div style={{ marginTop: "20px" }}>
        <input
          placeholder="Cédula"
          value={cedula}
          onChange={(e) => setCedula(e.target.value)}
          style={{ marginRight: "10px" }}
        />
        <button onClick={consultarLicencia}>Consultar Puntos Licencia</button>
      </div>

      {resultadoLicencia && (
        <div style={{ marginTop: "10px", padding: "10px", border: "1px solid gray" }}>
          <h3>Resultado Licencia:</h3>
          {resultadoLicencia.error ? (
            <p>{resultadoLicencia.error}</p>
          ) : (
            <div>
              <p>Puntos: {resultadoLicencia.puntos}</p>
              <p>Multas: {resultadoLicencia.multas}</p>
              {/* agrega más campos según tu objeto real */}
            </div>
          )}
        </div>
      )}
    </div>
  );
}
